// src/components/Header.jsx
import React from 'react';
import { NavLink } from 'react-router-dom';
import './Header.css';

const Header = () => {
  const getClassName = ({ isActive }) => (isActive ? 'nav-link active' : 'nav-link');

  return (
    <header className="header">
      <nav className="nav">
        <NavLink to="/" end className={getClassName}>
          Poƒçetna
        </NavLink>
        <NavLink to="/about" className={getClassName}>
          O nama
        </NavLink>
        <NavLink to="/pricing" className={getClassName}>
          Cjenovnik
        </NavLink>
        <NavLink to="/gigs" className={getClassName}>
          Svirke
        </NavLink>
        <NavLink to="/login" className={getClassName}>
          Prijava
        </NavLink>
        <NavLink to="/register" className={getClassName}>
          Registracija
        </NavLink>
        <NavLink to="/contact" className={getClassName}>
          Kontakt
        </NavLink>
      </nav>
    </header>
  );
};

export default Header;
